import React, { useState } from 'react';

function AddProduct() {
  const [name,setName]=useState('');
  const [price,setPrice]=useState('');
  const [category,setCategory]=useState('');
  const [company,setCompany]=useState('');
  return (
    <>
    <h1>Add Product</h1>
    <div className="product">
      
        <input  className='inputBox'
        type="text" placeholder='Enter  ProductName' 
        value={name} 
        onChange={(e)=>{setName(e.target.value)}}/>

        <input className='inputBox'
        type="number" placeholder='Enter Your Price' 
        value={price} 
        onChange={(e)=>{setPrice(e.target.value)}}/>

        <input className='inputBox'
        type="text" placeholder='Enter  Product category'   value={setCategory} 
        onChange={(e)=>{setCategory(e.target.value)}}/>
      
        <input className='inputBox'
        type="text" placeholder='Enter  Product Company'   value={name} 
        onChange={(e)=>{setName(e.target.value)}}/>

       
    </div>
    <button className='appbutton'>Add Product</button>
    </>
  )
}

export default AddProduct
